function Navbar() {
  return (
  
    <nav class="navbar">
      <div className="container">
        <a href="#">Hulk</a>
      
        <a href="#" className="logo is-active">Mavel</a>
        <a href="#">Venom</a>
      </div>
      
    </nav>
    
  );
}
export default Navbar;
